import React, {Component} from 'react';
import {BrowserRouter as Router, Route, Link} from 'react-router-dom';
import DailyEm from './DailyEm';
import MonthlyEm from './MonthlyEm';

export default function Emission() {
    return (
        <Router>
            <Link to='/emission/daily'><button>Daily</button></Link>
            <Link to='/emission/monthly'><button>Monthly</button></Link>
            <Link to='/emission/picture'><button>Picture</button></Link>

            <Route path='/emission/daily' component={DailyEm} />
            <Route path='/emission/monthly' component={MonthlyEm} />
        </Router>
    )
};
